require 'rails_helper'
# :name, :price, :currency, :start_date, :end_date, :picture_small
describe Api::V1::ItienariesController do
  describe 'POST /api/v1/trips/:trip_id/itienaries' do
    context "create itienary [+]" do
      let!(:user) { create(:manual_user) }
      let(:image64) { 'data:image/jpeg;base64,'}
      let(:trip) { create(:trip) }  
      let(:params) {
        {
          itienary: {
            title:    "name_of_itienary",
            content:  "lorem ipsum lorem ipsum lorem ipsum lorem ipsum lorem ipsum",
            transportation: "Bus",
            lat:      3.1383706,
            lng:      101.7056497,
            image_photo:    image64,
            image_alt:  "Planing 2016",
            image_name: "Planing 2016"
            
          }
        }
      }
      
    
      subject { post "/api/v1/trips/#{trip.id}/itienaries", params, { 'Authorization' => "Token token=\"#{user.authentication_token}\", email=\"#{user.email}\"" } }
    
      it "create itienary" do
        subject
        itienary = Itienary.find_by(title: params[:itienary][:title])
        
                
        expect(response.body).to eql({
          itienary: {
            id: itienary.id,
            title: itienary.title,
            content: itienary.content,
            transportation: itienary.transportation,
            location: itienary.location,
            lat: itienary.lat,
            lng: itienary.lng,
            image_count: itienary.image_count,
            start_date: itienary.start_date,
            photo_small: (itienary.images.last.present?) ? itienary.images.last.photo.url(:small) : '',
            trip_id: itienary.trip_id
          }
        }.to_json)
      end
      
      context "show itienary [+]" do
        let!(:user) { create(:manual_user) }
        let(:trip) { create(:trip) }          
        let!(:itienary) { create(:itienary, trip: trip) }
      
        subject { get "/api/v1/itienaries/#{itienary.id}", "", { 'Authorization' => "Token token=\"#{user.authentication_token}\", email=\"#{user.email}\"" } }
        it "itienary will showing" do
          subject
          
          expect(response.body).to eql({
            itienary: {
              id: itienary.id,
              title: itienary.title,
              content: itienary.content,
              transportation: itienary.transportation,
              location: itienary.location,
              lat: itienary.lat,
              lng: itienary.lng,
              image_count: itienary.image_count,
              start_date: itienary.start_date,
              photo_small: (itienary.images.last.present?) ? itienary.images.last.photo.url(:small) : '',
              trip_id: trip.id
            }
          }.to_json)
        end
        
      end
      
      context "update trip" do
        let!(:user) { create(:manual_user) }
        let(:trip) { create(:trip) }  
        let!(:itienary) { create(:itienary, trip: trip) }
        let(:params){
          {
            itienary: {
              transportation: "walking",
              image_name: 'test image',
              image_alt: 'alt test image',
              image_photo: 'data:image/jpeg;base64,'
            }
          }
        }
        
        subject { put "/api/v1/itienaries/#{itienary.id}", params, { 'Authorization' => "Token token=\"#{user.authentication_token}\", email=\"#{user.email}\"" } }
        it "updated itienary" do
          subject
          
          itienary2 = Itienary.find(itienary.id)
          expect(response.body).to eql({
            itienary: {
              id: itienary2.id,
              title: itienary2.title,
              content: itienary2.content,
              transportation: "walking",
              location: itienary2.location,
              lat: itienary2.lat,
              lng: itienary2.lng,
              image_count: itienary2.images.size,
              start_date: itienary2.start_date,
              photo_small: (itienary2.images.last.present?) ? itienary2.images.last.photo.url(:small) : '',
              trip_id: trip.id
            }
          }.to_json)
        end
      
      end
      
      context "all itienary belongs to trip" do
        let!(:user) { create(:manual_user) }
        let!(:trip) { create(:trip) }
        let!(:itienary) { create(:itienary, title: "itienary#1", trip: trip) }
        let!(:itienary2) { create(:itienary, title: "itienary#2", trip: trip) }        
        
        subject { get "/api/v1/trips/#{trip.id}/itienaries/", params, { 'Authorization' => "Token token=\"#{user.authentication_token}\", email=\"#{user.email}\"" } }
        it "show itienaries" do
          subject
          
          expect(response.body).to eql({
            itienaries: [
              { id: itienary.id,
                title: itienary.title,
                content: itienary.content,
                transportation: itienary.transportation,
                location: itienary.location,
                lat: itienary.lat,
                lng: itienary.lng,
                image_count: itienary.image_count,
                start_date: itienary.start_date,
                photo_small: (itienary.images.last.present?) ? itienary.images.last.photo.url(:small) : '',
                trip_id: itienary.trip_id },
              { id: itienary2.id,
                title: itienary2.title,
                content: itienary2.content,
                transportation: itienary2.transportation,
                location: itienary2.location,
                lat: itienary2.lat,
                lng: itienary2.lng,
                image_count: itienary2.image_count,
                start_date: itienary2.start_date,
                photo_small: (itienary2.images.last.present?) ? itienary2.images.last.photo.url(:small) : '',
                trip_id: itienary2.trip_id }
            ]
          }.to_json)
        end
      end
      

    end
  end
end